  `image` text COLLATE utf8_bin COMMENT '文章图片',
  `keywords` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '关键字',
  `description` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '描述',
  `stick` bit(1) DEFAULT b'0' COMMENT '置顶',
  `hits` int(11) DEFAULT '0' COMMENT '点击数',
  `content` longtext COLLATE utf8_bin COMMENT '文章内容',
  `copyfrom` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '文章来源',
  `tags` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '标签',
  `relation` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '相关文章',
  `attach_type` char(1) CHARACTER SET utf8 DEFAULT NULL COMMENT '附件类型,1音频，2视频，3文件',
  `attach_url` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '附件地址',
  `attach_size` bigint(20) DEFAULT NULL COMMENT '附件大小',
  `status` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否发布',
  `create_by` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '删除标记',
  `sign_count` int(11) DEFAULT '0' COMMENT '签到数',
  `agree_count` int(11) DEFAULT '0' COMMENT '点赞数',
  `audit_date` datetime DEFAULT NULL COMMENT '审核时间',
  `publish_date` datetime DEFAULT NULL COMMENT '发布时间',
  PRIMARY KEY (`id`),
  KEY `cms_article_create_by` (`create_by`) USING BTREE,
  KEY `cms_article_title` (`title`) USING BTREE,
  KEY `cms_article_keywords` (`keywords`) USING BTREE,
  KEY `cms_article_del_flag` (`del_flag`) USING BTREE,
  KEY `cms_article_weight` (`stick`) USING BTREE,
  KEY `cms_article_update_date` (`update_date`) USING BTREE,
  KEY `cms_article_category_id` (`category_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='文章表';

