DROP TRIGGER IF EXISTS `update_game_agency_balance_after_add_agencywithdraw`;
DELIMITER ;;
CREATE TRIGGER `update_game_agency_balance_after_add_agencywithdraw` AFTER INSERT ON `game_agency_withdraw` FOR EACH ROW BEGIN
    
IF( new.sum < 100)
THEN
UPDATE game_agency a
SET a.balance = a.balance -new.sum - 2
WHERE a.id = new.agency_id;
END IF;
IF( new.sum >= 100)
THEN
UPDATE game_agency b
SET b.balance = FORMAT (b.balance -new.sum*1.02,2)
WHERE b.id = new.agency_id;
END IF;
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update_game_users_balance_after_update_agency_withdraw`;
DELIMITER ;;
CREATE TRIGGER `update_game_users_balance_after_update_agency_withdraw` AFTER UPDATE ON `game_agency_withdraw` FOR EACH ROW BEGIN
    
IF( new.sum < 100 AND new.state=3)
THEN
UPDATE game_agency a
SET a.balance = a.balance+new.sum+2
WHERE a.id = new.agency_id;
END IF;
IF( new.sum >= 100 AND new.state=3)
THEN
UPDATE game_agency b
SET b.balance = FORMAT (b.balance + new.sum*1.02,2)
WHERE b.id = new.agency_id;
END IF;
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update_tasks_stat_after_insert_tasks`;
DELIMITER ;;
CREATE TRIGGER `update_tasks_stat_after_insert_tasks` AFTER INSERT ON `game_tasks` FOR EACH ROW BEGIN
SET @statid =(SELECT id FROM game_tasks_stat LIMIT 1);
UPDATE game_tasks_stat a
SET a.pulished = a.pulished + 1 
WHERE a.id = @statid;
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update_tasks_after_insert_usertasksitem`;
DELIMITER ;;
CREATE TRIGGER `update_tasks_after_insert_usertasksitem` AFTER INSERT ON `game_users_tasks_item` FOR EACH ROW BEGIN
set @statid =(SELECT id FROM game_tasks_stat limit 1);
UPDATE game_tasks a
SET a.num_remain = a.num_remain + 1 
WHERE a.id = new.tasks_id;
UPDATE game_tasks_stat b
SET b.done = b.done + 1 ,b.popularity=b.popularity + 1
WHERE b.id = @statid;
		
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update_game_users_balance`;
DELIMITER ;;
CREATE TRIGGER `update_game_users_balance` AFTER UPDATE ON `game_users_tasks_item` FOR EACH ROW begin
SET @statid =(SELECT id FROM game_tasks_stat LIMIT 1);
if(new.state = '3')
then
update game_users a
set a.balance = a.balance+(
	select reward from game_tasks
	where id=new.tasks_id)
where a.id = new.users_id;
UPDATE game_tasks_stat
SET totalreward = totalreward + (select reward from game_tasks where id = new.tasks_id)
WHERE id = @statid;
end if;
end
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update_game_users_balance_after_withdraw`;
DELIMITER ;;
CREATE TRIGGER `update_game_users_balance_after_withdraw` AFTER INSERT ON `game_withdraw` FOR EACH ROW BEGIN
IF( new.sum < 100)
THEN
UPDATE game_users a
SET a.balance = a.balance -new.sum - 2
WHERE a.id = new.users_id;
UPDATE game_agency ag
set ag.balance = ag.balance + new.sum 
where ag.id = (SELECT agency_id from game_users where id = new.users_id);
END IF;
IF( new.sum >= 100)
THEN
UPDATE game_users b
SET b.balance = FORMAT (b.balance -new.sum*1.02,2)
WHERE b.id = new.users_id;
UPDATE game_agency agc
SET agc.balance = agc.balance + new.sum
WHERE agc.id = (SELECT agency_id FROM game_users WHERE id = new.users_id);
END IF;
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update_game_users_balance_after_update_withdraw`;
DELIMITER ;;
CREATE TRIGGER `update_game_users_balance_after_update_withdraw` AFTER UPDATE ON `game_withdraw` FOR EACH ROW BEGIN
    
IF( new.sum < 100 and new.state=3)
THEN
UPDATE game_users a
SET a.balance = a.balance+new.sum+2
WHERE a.id = new.users_id;
update game_agency ag
set ag.balance = ag.balance - new.sum
where id = (select agency_id from game_users where id = new.users_id);
END IF;
IF( new.sum >= 100 and new.state=3)
THEN
UPDATE game_users b
SET b.balance = FORMAT (b.balance + new.sum*1.02,2)
WHERE b.id = new.users_id;
UPDATE game_agency agc
SET agc.balance = agc.balance - new.sum
WHERE id = (SELECT agency_id FROM game_users WHERE id = new.users_id);
END IF;
END
;;
DELIMITER ;
